import React from "react";

function TeamComponent (props)
{
    return (
        <div>
            <ul>
                <li>team name: {props.data.team_name} </li>
    <li>team rank: {props.data.team}</li>
            </ul>
        </div>
    );
}

export default TeamComponent;
